 const [people, setPleople] = React.useState();
 const user = auth.currentUser;
 React.useEffect(() => {
  setPleople(user);
 }, []);

 return (
  <>
   {people ? <ReturnValiDExchange /> : <SignUp />}
  </>
 );
};
